import React, { Component } from 'react';
import { Container, Avatar, Typography, Grid, TextField } from '@material-ui/core';
import styleForm from './estiloForm';
import IconoFormulario from "@material-ui/icons/LocalActivityOutlined"
class RegistrarEstudiante extends Component {
    render() {
        return (
           <Container maxWidth="md">
               <div style={styleForm.paper}>
                    <Avatar style={styleForm.Avatar}>
                        <IconoFormulario/>
                    </Avatar>
                    <Typography component="h1" variant="h5" >Crea una cuenta Estudiante</Typography>
                    <form style={styleForm.formulario}> 
                        <Grid container spacing={2} >
                                <Grid item md={12} xs={12}> 
                                    <TextField name="nombre" fullWidth label="Ingrese su nombre"/>
                                </Grid>
                                <Grid item md={12} xs={12}> 
                                    <TextField name="apellido" fullWidth label="Ingrese su apellido"/>
                                </Grid>
                                <Grid item md={12} xs={12}> 
                                    <TextField name="correo" fullWidth label="Ingrese su correo"/>
                                </Grid>
                                <Grid item md={12} xs={12}> 
                                    <TextField name="contraseña" type="password" fullWidth label="Ingrese su contraseña"/>
                                </Grid>
                        </Grid>
                    </form>
               </div>
           </Container>
        );
    }
}

export default RegistrarEstudiante;
